import React from "react";
import "./location.css";

export const LocationCard = () => (
    <section className="location">
        <h3 className="location_name">Cody Jones</h3>
        <div className="location_address">600 Pennsylvania Ave NW Washington, DC 20500</div>
    </section>
)
